PriceConverter.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity >0.7.0 <0.9.0;

import {AggregatorV3Interface} from "@chainlink/contracts/src/v0.8/shared/interfaces/AggregatorV3Interface.sol";

contract PriceConverter {
    uint256 price;

    function getPrice()
        public
        view
        returns (
            int256,
            uint80,
            uint256,
            uint80
        )
    {
        AggregatorV3Interface priceFeed = AggregatorV3Interface(
            0x694AA1769357215DE4FAC081bf1f309aDC325306
        );
        (uint80 roundID, int256 answer, , uint256 updatedAt, uint80 answeredInRound) = priceFeed.latestRoundData();
        require(answer > 0, "Invalid price data from Chainlink");
        return (answer, roundID, updatedAt, answeredInRound);
    }

    // function getConversionRate(uint256 ethAmount) internal view returns (uint256) {
    //     uint256 ethPrice = getPrice(); // Giá ETH/USD
    //     return (ethPrice * ethAmount) / 1e18; // Giá trị USD tương đương với ETH gửi vào
    // }
}

